import { useEffect, useState } from "react";

export default function Todo({ todos }) {
  return (
    <div>
      {todos.map((todo) => (
        <ul key={todos.id} class="list-group">
          <li>{todo.userId}</li>
          <li>{todo.title}</li>
          <li>{todo.completed}</li>
        </ul>
      ))}
    </div>
  );
}
